def launch_listener():
       start_listener=Listener(folder_names=folder_names,ports_tf='FALSE')

def install_non_gui(arg):
       homedir=os.path.split(os.path.split(arg[0])[0])[0]
       homedir=os.path.join(homedir,'FORKS')
       repos=[]
       if '-d' in arg:
              for i in range(arg.index('-i')+1,arg.index('-d')):
                     repos.append(arg[i])
                     all_repos=''.join(repos)
                     all_repos= all_repos.split(',')
              try:
                     print(f"Installing {all_repos} in {arg[arg.index('-d')+1]}")
                     if os.path.isdir(arg[arg.index('-d')+1]):
                            homedir=arg[arg.index('-d')+1]
                     else:
                            print('-d not a dir')
              except IndexError:
                     print('no -d specified')
                     if os.path.isdir(homedir):
                          print(f'-d set to {homedir}')
       elif os.path.isdir(homedir):
              for i in range(arg.index('-i')+1,len(arg)):
                     repos.append(arg[i])
                     all_repos=''.join(repos)
                     all_repos= all_repos.split(',')
              print(f"Installing {all_repos} in {homedir}")
       else:
              print('Specify -d directory to Install in')

       for repo in all_repos:
              install_it=nonGui(default_repos,folder_names, bin_files,repo, homedir)

def GUI_client():

       root = Tk()
       root.title("Blockchain manager")

       root.configure(background="turquoise")

       startup_logo_image=""
       root.tk.call('wm', 'iconphoto',root._w, tk.PhotoImage(data=startup_logo_image))

       label_temp_source=''

       image_label_temp=PhotoImage(data=label_temp_source)
       label_temp=Label(root,image=image_label_temp,background='turquoise')
       label_temp.image=image_label_temp
       root.configure(background='turquoise')
       label_temp.place(x=30,y=10)

       img_source=''
       image_file_path =PhotoImage(data=img_source)
       label = Label(root, image=image_file_path, background='turquoise')
       label.image=image_file_path
       label.place(x=30,y=70)
       root.geometry("550x250")

       install_img_source=''
       install_img=PhotoImage(data=install_img_source)
       install_label = Label(root, image=install_img, background='turquoise',text='INSTALL FROM REPO',fg='white',font='Arial 16',compound=BOTTOM)
       install_label.place(x=250, y=90)

       madmax_gui_img_source=""
       tractor_img=PhotoImage(data=madmax_gui_img_source)
       tractor_lbl=Label(root, image=tractor_img, background='turquoise',text='MADMAX GUI',fg='white',font='Arial 16',compound=BOTTOM)
       tractor_lbl.place(x=400,y=150)

       settings_img_source=""
